import PropTypes from 'prop-types';

const Card = props => {
    const { title, children, text, ...configCardProps } = props;

    return (
        <div className='bg-white rounded-xl shadow p-3'>
            <h1>{title}</h1>
            <div>{children}</div>
            <span>{text}</span>
        </div>
    );
};

Card.propTypes = {
    title: PropTypes.string,
    text: PropTypes.string,
};

export default Card;
